import "../components/App.scss";
import NumbersOne from "./NumbersOne";
import InputTwo from "./InputTwo";

class App extends React.Component {
  render() {
    return (
      <>
        <div>
          <InputTwo />
        </div>
        <ul className="App">
          My list numbers
          <NumbersOne />
        </ul>
      </>
    );
  }
}

export default App;
